import React from "react";
import { TodoIcon } from " ./TodoIcon ";

function DeleteIcon({ onDelete}) {
    return (
        <todoIcon
        type="delete"
        color="gray"
        onClick={onDelete}
        />
    );
}
export { DeleteIcon } ;
